const Todo = (props) => {
    return (
        <h1>Learn ReactJs </h1>
    )
}

function TodoFunction() {
    return (
        <div>
            <h1>ReactJs</h1>
            <p>
                ReactJs is a JavaScript library for building user interfaces.
            </p>
        </div>
    )
}

export default {Todo, TodoFunction}
